const texteUnAng="Front-end developer";
const texteDeuxAng="I am looking for professional experience";
const texteTroisAng="Open to mobility";
const texteUnFr="Développeur front-end";
const texteDeuxFr="Je suis à la recherche d'une expérience professionnelle";
const texteTroisFr="ouvert à la mobilité";

const tabTextePresentation={
    fr:[texteUnFr,texteDeuxFr,texteTroisFr],
    ang:[texteUnAng,texteDeuxAng,texteTroisAng]
}

export default tabTextePresentation;
